import React, { Component } from "react";
import ReactDOM from "react-dom";
import EditPage from "./components/editPage";
import "./css/main.css";

class App extends Component {
  render() {
    return (
      <div className="App">
        <EditPage />
      </div>
    );
  }
}

export default App;

ReactDOM.render(<App />, document.getElementById("root"));
